import React from "react";
import {
    withGoogleMap,
    withScriptjs,
    useLoadScript,
    GoogleMap,
    Marker,
    InfoWindow
} from "react-google-maps";
import Navbar from "../components/Navbar";
import logo from '../icons/Home.png';
import './homepage.css';
import * as propertyData from "../components/skateboard-parks.json";
import Background from '../icons/background.png';

var backgroundStyle = {
    position: 'absolute',
    backgroundSize: 'cover',
    top: 0,
    bottom: 0,
    left: 0,
    right: 0,
    backgroundRepeat: 'no-repeat',
    opacity: '0.3',
    backgroundImage: `url(${Background})`
};
var logoStyle = {
    width: "160px",
    height: "160px",
    backgroundRepeat: 'no-repeat',
    margin: '184px 0 0 178px'
};
var nameStyle = {
    position: 'absolute',
    fontSize: '63px',
    top: '217px',
    left: '398px'
};

class HomePage extends React.Component {
    constructor(props) {
        super(props);
        this.state = { pc: [] };
    }


    render() {

        return (
            <>
                <div className="home" style={backgroundStyle}>
                </div>
                <div className="title-name">
                    <img className="homepage-logo" src={logo} style={logoStyle} alt="Logo" />
                    <h1 className="name" style={nameStyle}>AusNewRenters</h1>
                </div>




            </>

        );
    }
}





export default HomePage;
